import { useState } from "react";
import "../StyleCSS/Headerbox.css";
import { Outlet, Link } from "react-router-dom";
function Headerbox(){


    const [tab, setTab] = useState("login");
    // login
    // logging
    // logout
    return(    
        
        <div>
        <div className="headerbox">
        <Link Link to="/" className="headerboxcomponent logo" onClick={() => tab === "logging" ? setTab("logout"): ""}>MovieMangement</Link>
        {logRender(tab,setTab)}
        </div>

        <Outlet />
        </div>
    )
}


function logRender(tab, setTab){
    if(tab === "logout")
        return(logOut(tab,setTab));
    else if(tab === "logging")
        return(Logging(tab,setTab));
    else if (tab === "login")
        return(logIn(tab,setTab));
}

function logOut(tab, setTab){
    return(
    <div className="header-links">
        <Link to="/films" className="headerboxcomponent">Films</Link>
        <Link to="/members" className="headerboxcomponent">Members</Link>
        <div className="headerboxcomponent" onClick={() => setTab("logging")}>
            Login
        </div>
        <Link to = "/signup" className="headerboxcomponent">Signup</Link>
        </div>
        )
}



function Logging({ tab, setTab }) {
    const [formData, setFormData] = useState({
      username: "",
      password: ""
    });
    const navigate = useNavigate();
  
    // Handle form input changes
    const handleInputChange = (event) => {
      const { name, value } = event.target;
      setFormData((prevData) => ({
        ...prevData,
        [name]: value
      }));
    };
  
    // Handle form submission
    const handleSubmit = async (event) => {
      event.preventDefault();
  
      const { username, password } = formData;
  
      // Validate inputs
      if (!username || !password) {
        alert("Please enter both username and password");
        return;
      }
  
      // Send login request to backend (you need to set up the API URL)
      try {
        const response = await fetch(`http://localhost:3001/api/users/checklogin?username=${username}&password=${password}`, {
          method: "GET",
        });
  
        const result = await response.json();
  
        if (result.data && result.data.length > 0) {
          // Successful login, set tab to "logged in"
          setTab("login");
          // Store userID in the context or local storage if needed
          localStorage.setItem("userID", result.data[0].USERID);
          navigate("/films"); // Redirect to films page or wherever you want
        } else {
          alert("Invalid username or password");
        }
      } catch (error) {
        console.error("Error during login:", error);
        alert("An error occurred during login. Please try again later.");
      }
    };
  
    return (
      <div>
        <div className="Login-tab">
          <form className="login-block" onSubmit={handleSubmit}>
            <div className="login-exit-to-logout" onClick={() => setTab("logout")}>
              X
            </div>
            <label>Username</label>
            <input
              type="text"
              name="username"
              value={formData.username}
              onChange={handleInputChange}
            />
            <label>Password</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleInputChange}
            />
            <input className="login-submit" type="submit" value="Sign In" />
          </form>
        </div>
      </div>
    );
  }


    function logIn(tab,setTab){
        return(
            <div>
        <div className="header-links">
        <Link to="memberonly" className="headerboxcomponent">insertName</Link>
        <Link to="/films" className="headerboxcomponent">Films</Link>
        <Link to="/members" className="headerboxcomponent">Members</Link>
        <div className="headerboxcomponent" onClick={() => setTab("logout")}>
            Logout
        </div>
        </div>
        </div>
        )
    }

export default Headerbox;
